import {Link} from "react-router-dom"
const Navbar = ({ darkMode, toggleDarkMode }) => {
    const scrollToSection = (id) => {
      const element = document.getElementById(id);
      if (element) {
        element.scrollIntoView({ behavior: 'smooth' });
      }
    };

    return (<nav className ="nav">
        {/*turn into toggle graphic in the future*/}
        <button className="toggle-dark-mode" onClick={toggleDarkMode}>
          <h3 className='navbar_txt'>{darkMode ? 'Inverted' : 'Regular'}</h3>
        </button>

        <ul>
        <Link to="/"><h3 className='navbar_txt'>Home</h3></Link>
        <Link to="/allprojects"><h3 className='navbar_txt'>All Projects</h3></Link>
        <button className='navbar_txt' onClick={() => scrollToSection('experience')}>
        Experience
          </button>
        <Link to="/beyondtech"><h3 className='navbar_txt'>Beyond Tech</h3></Link>
        <a className="mailto" href="mailto:tranviviana@berkeley.edu"><h3 className='navbar_txt'>Contact</h3></a>
        <Link to="/resume"><h3 className='navbar_txt'>Resume</h3></Link>
        </ul>
    </nav>
)}
export default Navbar;
